The SPC Storm Reports KML/KMZ is experimental.&lt;br&gt;
Adjust the time slider on top of the GoogleEarth display to view reports.&lt;br&gt;
Please send feedback to http://www.spc.noaa.gov/misc/feedback.html&lt;br&gt;
NOTE: Storm Reports data are preliminary and unofficial.&lt;br&gt;
For official reports, go to NCDC http://www4.ncdc.noaa.gov/cgi-win/wwcgi.dll?wwEvent~Storms&lt;br&gt;
